webpackJsonp([19386905403033],{8231:function(e,o){e.exports={data:{post:{html:'<p>It took me nearly two years, but I finally did it. I was able to get the better of Facebook. Yesterday I was able to celebrate my birthday without a single greeting on social media, even if my wife very nearly <a href="https://www.facebook.com/papascott/posts/10152947844446281y">gave me away</a>.</p>\n<p>It was heaven! It was bliss! I was living free of the distractions of the digital world, if only for one day. My day! For me, me alone!</p>\n<p>I hope your day was a good one too.</p>',fields:{title:"How I Punked Facebook",date:"10 Feb 2015",url:"https://papascott.de/2015-02-10-how-i-punked-facebook/"}}},pathContext:{slug:"/2015-02-10-how-i-punked-facebook/",prev:{fields:{title:"Where Were You?",date:"09 Nov 2014",slug:"/2014-11-09-where-were-you/"}},next:{fields:{title:"Confirmation",date:"20 Apr 2015",slug:"/2015-04-20-confirmation/"}}}}}});
